ཱིྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱྀུmuཱཱཱཱིིིུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུ